import React from "react";
import { ArrowUpRight } from "@phosphor-icons/react";

export default function Link(props) {
    return (
        <div className="bg-white rounded p-1">
            <a href={props.link} className="flex justify-between">
                <div className="flex justify-center items-center bg-zinc-900 text-white text-2xl rounded h-12 aspect-square">
                    a
                </div>

                <div>
                    {props.title}
                </div>

                <div>
                    <ArrowUpRight size={24} />
                </div>
            </a>
        </div>
    )
}
